import { useNavigate } from "react-router-dom";

export default function Home() {
  const navigate = useNavigate();

  // üî¢ Dummy stats (baad me backend se connect kar sakte ho)
  const stats = {
    today: 42,
    waiting: 15,
    served: 27,
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        padding: "40px",
        background: "linear-gradient(135deg, #eef2ff, #f5f3ff)",
      }}
    >
      {/* ===== HERO ===== */}
      <div style={{ textAlign: "center", marginBottom: "40px" }}>
        <h1 style={{ fontSize: "36px", color: "#4338ca" }}>
          üè• Care Hospital
        </h1>
        <p style={{ fontSize: "18px", color: "#374151", marginTop: "10px" }}>
          Smart Queue Management for Better Healthcare
        </p>

        <button
          onClick={() => navigate("/queue")}
          style={{
            marginTop: "20px",
            padding: "12px 25px",
            backgroundColor: "#4f46e5",
            color: "#fff",
            border: "none",
            borderRadius: "8px",
            fontSize: "16px",
            cursor: "pointer",
          }}
        >
          Go to Queue ‚Üí
        </button>
      </div>

      {/* ===== STATS ===== */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(220px, 1fr))",
          gap: "20px",
          maxWidth: "900px",
          margin: "0 auto 40px",
        }}
      >
        <StatCard
          title="üë• Today Patients"
          value={stats.today}
          color="#4f46e5"
        />
        <StatCard
          title="‚è≥ Waiting"
          value={stats.waiting}
          color="#f59e0b"
        />
        <StatCard
          title="‚úÖ Served"
          value={stats.served}
          color="#16a34a"
        />
      </div>

      {/* ===== QUICK NAVIGATION ===== */}
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(auto-fit, minmax(220px, 1fr))",
          gap: "20px",
          maxWidth: "900px",
          margin: "auto",
        }}
      >
        <Card
          title="üìã Queue"
          desc="Manage patient queues easily"
          onClick={() => navigate("/queue")}
        />
        <Card
          title="üë§ Profile"
          desc="View your account details"
          onClick={() => navigate("/profile")}
        />
        <Card
          title="‚Ñπ About"
          desc="Know about our hospital"
          onClick={() => navigate("/about")}
        />
      </div>
    </div>
  );
}

/* ===== STAT CARD ===== */
function StatCard({ title, value, color }) {
  return (
    <div
      style={{
        background: "#ffffff",
        padding: "25px",
        borderRadius: "14px",
        boxShadow: "0 10px 20px rgba(0,0,0,0.08)",
        textAlign: "center",
        borderTop: `6px solid ${color}`,
      }}
    >
      <h3 style={{ color: "#374151", fontSize: "16px" }}>{title}</h3>
      <p
        style={{
          marginTop: "10px",
          fontSize: "32px",
          fontWeight: "bold",
          color,
        }}
      >
        {value}
      </p>
    </div>
  );
}

/* ===== NAV CARD ===== */
function Card({ title, desc, onClick }) {
  return (
    <div
      onClick={onClick}
      style={{
        background: "#ffffff",
        padding: "20px",
        borderRadius: "12px",
        boxShadow: "0 10px 20px rgba(0,0,0,0.08)",
        cursor: "pointer",
        transition: "0.3s",
      }}
      onMouseEnter={(e) =>
        (e.currentTarget.style.transform = "translateY(-5px)")
      }
      onMouseLeave={(e) =>
        (e.currentTarget.style.transform = "translateY(0)")
      }
    >
      <h3 style={{ color: "#4338ca" }}>{title}</h3>
      <p style={{ marginTop: "8px", color: "#374151" }}>{desc}</p>
    </div>
  );
}
